import React, { Component } from "react";
import NavComplete from "../components/navcomplete";

class Newsletter extends Component {
  state = {};
  render() {
    return (
      <div
        style={{
          alignContent: "center",
          justifyContent: "center",
        }}
      >
        <NavComplete />
        <div>
          <div>Join my newsletter</div>
          <a href="#">
            <div>Join here</div>
          </a>
        </div>
      </div>
    );
  }
}

export default Newsletter;
